import "./App.css";

function Heading() {
  return <h1>My Favourite Cities</h1>;
}

function List() {
  return (
    <ul>
      <li>Bengaluru</li>
      <li>Mumbai</li>
      <li>Delhi</li>
    </ul>
  );
}

function App() {
  return (
    <div>
      <Heading />
    </div>
  );
}

export default App;
